import { useState } from "react";
import Login from "./Login";
import Signup from "./Signup";

function LoginSignup(){
    const [showLogin, setShowLogin] = useState(true)

    return(
        <>
            <h1>LoginSignup Page!!</h1>
            {showLogin ? 
            (
                <p> Log in page</p>
            )
            :
            (
                <p> Signup page</p>
            )

            }
        </>

    )
};

export default LoginSignup;



